import React from "react";

import Main from "./main";

import Ei from "./sample";
import { Vt } from "./sample";

function Votehere(){
    return(
        <div>
            <Main card={<Ei />} page='Votehere'  />

        </div>
    );

}


function Vote(){
    return(
        <div>
            <Main card={<Vt />} />
        </div>
    );
}
export default Votehere;
